/*Table structure for table `sys_js_css_helper` */

CREATE TABLE `sys_js_css_helper` (
  `idx` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `module` varchar(41) CHARACTER SET utf8 DEFAULT NULL,
  `jscss` enum('js','css') CHARACTER SET utf8 DEFAULT NULL,
  `url` varchar(89) CHARACTER SET utf8 DEFAULT NULL,
  `assets` varchar(20) DEFAULT NULL,
  `rank` double DEFAULT NULL,
  `loaded` tinyint(1) NOT NULL DEFAULT 1,
  PRIMARY KEY (`idx`)
) ENGINE=InnoDB AUTO_INCREMENT=815 DEFAULT CHARSET=latin1;

